import React from 'react';

// Components
import Product from './Product';

const Products = props => {
	return (
		<div className="products-container">
			{props.products.map(product => (
				<Product
					key={product.key}
					product={product}
					addItem={props.addItem}
				/>
			))}
		</div>
	);
};

export default Products;
